import React from 'react';


const Uploaded = (props) => {
    const { project } = props;
    console.log(props)
    if (project) {
        return (
            <ul>
              <li>{project.fileName}</li>
            </ul>
        )}else{
            return (
                <div className='grey-text text-darken-3'>hello</div>
            )
           
            
        }
    };



    export default Uploaded;
